INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (24, 10021, 0.0, 0.0, 0.0, "あうぅ～残念さ～\nマジムンに魂を\n奪われちゃったかな～？", "2019/07/31 12:00:00", 4, "カオリ（サマー）", 1, 4, "2030/12/17 14:59:59", 110501, 24015);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (24, 10021, 0.0, 0.0, 4.0, "今日は踊りのキレも悪いよ～\nゴーヤーっぽいもの食べて、元気回復さ～！", "2019/07/31 12:00:00", 1, "カオリ（サマー）", 2, 4, "2030/12/17 14:59:59", 110501, 24016);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (24, 10021, 0.0, 0.0, 0.0, "マジムンだらけで目が回るさ～！\nふらふらさ～！", "2019/07/31 12:00:00", 4, "カオリ（サマー）", 3, 4, "2030/12/17 14:59:59", 110501, 24017);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (24, 10021, 0.0, 0.0, 5.2, "なんくるない、なんくるない\n次、頑張ればいいんだよ～！\n海で泳いで\nリフレッシュするさー！", "2019/07/31 12:00:00", 2, "カオリ（サマー）", 4, 1, "2030/12/17 14:59:59", 110501, 24018);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (24, 10021, 0.0, 0.0, 4.2, "恥ずかしいところ\n見られちゃったね～\n水着？　水着のことじゃないよー？", "2019/07/31 12:00:00", 6, "カオリ（サマー）", 5, 5, "2030/12/17 14:59:59", 110501, 24019);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (24, 10021, 0.0, 0.0, 0.0, "絶好調さ～！　この調子で\n海の平和を取り戻すよ～！\n楽しい夏が待ってるさ～！", "2019/07/31 12:00:00", 2, "カオリ（サマー）", 6, 2, "2030/12/17 14:59:59", 110501, 24020);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (24, 10021, 0.0, 0.0, 6.4, "何匹で襲ってきたって\n私はマブイを落っことさないよ～！\nくしゅん！　あ……\n今のくしゃみで落っこちたかも～？", "2019/07/31 12:00:00", 6, "カオリ（サマー）", 7, 1, "2030/12/17 14:59:59", 110501, 24021);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (24, 10021, 0.0, 0.0, 0.0, "ひーやーさーさー♪\n戦いの後は、踊りを踊って\n気分スッキリさ～！", "2019/07/31 12:00:00", 2, "カオリ（サマー）", 8, 2, "2030/12/17 14:59:59", 110501, 24022);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (24, 10021, 0.0, 0.0, 10.08, "あれ～？　戦ってるうちに\n水着がどっか行っちゃった～？\nねぇキミ、どっかで見なかった～？\nなんで離れるさ～？", "2019/07/31 12:00:00", 3, "カオリ（サマー）", 9, 6, "2030/12/17 14:59:59", 110501, 24023);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (24, 10021, 0.0, 0.0, 5.0, "まだまだ私は元気だよ～！\nマジムンでもなんでも、\nどんとこーいさー♪", "2019/07/31 12:00:00", 2, "カオリ（サマー）", 10, 1, "2030/12/17 14:59:59", 110501, 24024);
INSERT INTO `v1_21e3a4275f958ad7573ff8d4f2f23b07d878381a3d07516ed771d033ee69b6bf` VALUES (24, 10021, 0.0, 0.0, 0.0, "私の空手は世界最強さ～！\n夏の陽射しと青い海も合わされば、\n向かうところ敵なしだよー！", "2019/07/31 12:00:00", 2, "カオリ（サマー）", 11, 2, "2030/12/17 14:59:59", 110501, 24025);
